import{_ as t,c as o,ah as a,o as r}from"./chunks/framework.BWXOFiC5.js";const i="/assets/reportingNavigation.Dnuqau80.png",n="/assets/computers-report.BPAQPovB.png",s="/assets/CIS-ungrouped.CEy3ewuZ.png",l="/assets/CIS-Grouped.BURmNG5r.png",p="/assets/DCS-Ungrouped.DqZVqmPL.png",h="/assets/DCS-Grouped.DrbUnWB7.png",u="/assets/UserAffinity.J4o36jNf.png",y=JSON.parse('{"title":"Reports","description":"","frontmatter":{},"headers":[],"relativePath":"Documentation/Administration/reporting.md","filePath":"Documentation/Administration/reporting.md"}'),c={name:"Documentation/Administration/reporting.md"};function m(d,e,b,f,g,v){return r(),o("div",null,e[0]||(e[0]=[a('<h1 id="reports" tabindex="-1">Reports <a class="header-anchor" href="#reports" aria-label="Permalink to &quot;Reports&quot;">​</a></h1><h2 id="overview" tabindex="-1">Overview <a class="header-anchor" href="#overview" aria-label="Permalink to &quot;Overview&quot;">​</a></h2><p>This document will go over available reports within ImmyBot, and</p><h2 id="prerequisites" tabindex="-1">Prerequisites <a class="header-anchor" href="#prerequisites" aria-label="Permalink to &quot;Prerequisites&quot;">​</a></h2><p>An active ImmyBot subscription or trial</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>You must be an MSP Admin or Tenant Admin to export results from these pages</p></div><h2 id="navigation" tabindex="-1">Navigation <a class="header-anchor" href="#navigation" aria-label="Permalink to &quot;Navigation&quot;">​</a></h2><p>You can get to the Reports by clicking on the Reporting tab on the left hand side of your ImmyBot instance and clicking on the appropriate Report.</p><p><img src="'+i+'" alt="alt text"></p><p>All Reports have an export option, you must be an MSP Admin or a Tenant Admin to utilize this functionality. The export option is to the left of the search bar.</p><h2 id="available-reports" tabindex="-1">Available Reports <a class="header-anchor" href="#available-reports" aria-label="Permalink to &quot;Available Reports&quot;">​</a></h2><h3 id="computers" tabindex="-1">Computers <a class="header-anchor" href="#computers" aria-label="Permalink to &quot;Computers&quot;">​</a></h3><p>This report will give you all of the computers available in ImmyBot. You can select various columns by clicking on the column selection menu that is to the left of the search bar. <img src="'+n+'" alt="alt text"></p><h3 id="computer-inventory" tabindex="-1">Computer Inventory <a class="header-anchor" href="#computer-inventory" aria-label="Permalink to &quot;Computer Inventory&quot;">​</a></h3><p>This page shows the latest inventory results for all computers. In this report you can group the information by column. Simply drag the column to the top left of the table.</p><h4 id="ungrouped" tabindex="-1">Ungrouped <a class="header-anchor" href="#ungrouped" aria-label="Permalink to &quot;Ungrouped&quot;">​</a></h4><p><img src="'+s+'" alt="alt text"></p><h4 id="grouped" tabindex="-1">Grouped <a class="header-anchor" href="#grouped" aria-label="Permalink to &quot;Grouped&quot;">​</a></h4><p><img src="'+l+'" alt="alt text"></p><h3 id="computer-software" tabindex="-1">Computer Software <a class="header-anchor" href="#computer-software" aria-label="Permalink to &quot;Computer Software&quot;">​</a></h3><p>This page shows all of the global software detected on your computers. You can select various columns by clicking on the column selection menu that is to the left of the search bar. In this report you can group the information by column. Simply drag the column to the top left of the table.</p><h4 id="ungrouped-1" tabindex="-1">Ungrouped <a class="header-anchor" href="#ungrouped-1" aria-label="Permalink to &quot;Ungrouped&quot;">​</a></h4><p><img src="'+p+'" alt="alt text"></p><h4 id="grouped-1" tabindex="-1">Grouped <a class="header-anchor" href="#grouped-1" aria-label="Permalink to &quot;Grouped&quot;">​</a></h4><p><img src="'+h+'" alt="alt text"></p><h3 id="user-affinity" tabindex="-1">User Affinity <a class="header-anchor" href="#user-affinity" aria-label="Permalink to &quot;User Affinity&quot;">​</a></h3><p>ImmyBot periodically runs whoami /upn on all computers and keeps a rolling list of the last 10 UPNs. It assigns the Primary User of the computer to the &quot;Person&quot; (Synced from Azure) with the matching UPN. For environments without AzureAD, ImmyBot will lookup the UPN of the Person from a Domain Controller in the computer&#39;s Tenant.</p><p><img src="'+u+'" alt="alt text"></p><h3 id="dashboard" tabindex="-1">Dashboard <a class="header-anchor" href="#dashboard" aria-label="Permalink to &quot;Dashboard&quot;">​</a></h3><p>ImmyBot has a Dashboard that you can view session results from. This information is here, because the Dashboard is indirectly related to reporting, however it is it&#39;s own module.</p><p><br><br><br></p><div class="note custom-block github-alert"><p class="custom-block-title">Document information</p><p>Author: Mark Gomez <br> Date Published: 09/19/2025 <br> Date Revised: N/A <br> Version Number: 1.0</p></div>',32)]))}const _=t(c,[["render",m]]);export{y as __pageData,_ as default};
